description:
Captured and enslaved in a mine, the young grouse lives a sad
 existence. The labor camp is rough and brutal, the grouse are
 suppressed and forced to chickens despising work. Your task:
 to find a lost artifact that gives its owner the infinite power
 of the Dragon. A cute chicken in bondage girl is the only bright
 spot of our hero. The young lady is one day in a dangerous
 situation and while the grouse they defended it discovered
 its first combat skills.
